import React, {Component} from 'react';
import ServiceBanneritem from './ServiceBanneritem';

class ServiceBanner extends Component {
    render(){

        let {Title, TitleN, TitleP, Simage, ClassC} = this.props;

        return(
            <section className={`servicesInt text-center ${ClassC}`}>
                <div className="container">
                    <div className="servicesInt_content">
                        <h3>{Title}<strong>{TitleN}</strong> </h3>
                        <p>{TitleP}</p>
                        <img src={require ("../../img/sliderImg/" + Simage).default} alt=""/>

                    </div>
            
                </div>
            </section>
        )
    }
}

export default ServiceBanner;
